import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
    </Head>
    <Navbar />
    <section>
      <div className="container">
        {props.children}
      </div>
    </section>
  </div>
);

export default Layout;
